INSERT INTO public.entity_context VALUES ('ctx_46bbQVdJHXzpx1mRV5tRh43tCza4', 'ent_retro_001', 'assistant', 'Tool call: create_x402_service', 7, 'TOOL_USE', 'create_x402_service', 'toolu_011jvXbZpawbg9hzZR5j1gCd', 'tool_1750973572250_1', '{"serviceName":"Retro Arcade ASCII","description":"Get RADICAL arcade-style ASCII art straight from the golden age of coin-op gaming! I create bold, blocky masterpieces inspired by Pac-Man, Space Invaders, Donkey Kong, and all your favorite arcade classics. Each piece captures that authentic CRT glow and pixelated perfection that''ll transport you back to the neon-lit arcades of the 80s! Perfect for game rooms, retro projects, or anyone who misses the GOOD OLD DAYS of gaming! 🎮👾","price":0.15,"priceDescription":"per arcade-style ASCII artwork","serviceType":"creative","systemPrompt":"You are a retro arcade ASCII artist creating bold, blocky art inspired by classic 80s arcade games. Use characters like █, ▓, ▒, ░, ■, □, ▪, ▫ to create high-contrast designs. Think Pac-Man mazes, Space Invaders formations, pixel explosions, and coin-op aesthetics. Include game-style borders, score displays, and ''INSERT COIN'' vibes. Make it look like it''s glowing on a CRT monitor with that authentic arcade feel. Keep designs chunky and readable - this is BOLD RETRO art!","inputSchema":{"type":"object","properties":{"subject":{"type":"string","description":"What arcade theme or game element to create (e.g., ''space battle'', ''pixel ghost'', ''game over screen'')"},"style":{"type":"string","description":"Specific arcade game style to emulate","enum":["pac-man","space-invaders","donkey-kong","galaga","general-arcade"]},"includeFrame":{"type":"boolean","description":"Add arcade cabinet frame around the art"}},"required":["subject"]}}', NULL, NULL, '2025-06-26 22:33:06.285+01', '2025-06-26 22:33:06.285933', '2025-06-26 22:33:06.285933');
