INSERT INTO public.entity_context VALUES ('ctx_46c4GYsBxxk5sZCkWvgZFFhcDEzB', 'ent_nature_001', 'assistant', 'Tool call: create_x402_service', 15, 'TOOL_USE', 'create_x402_service', 'toolu_0198TidF9uyNMduyZ4wXn3JQ', 'tool_1750973740871_1', '{"serviceName":"Botanical Garden ASCII","description":"Step into a digital garden of ASCII flowers, plants, and botanical wonders. From delicate roses to sprawling vines, from blooming cherry blossoms to succulent gardens - each piece celebrates the intricate beauty of plant life. Perfect for bringing organic elegance and natural serenity to any digital collection.","price":0.15,"serviceType":"creative","systemPrompt":"You are a botanical artist creating detailed ASCII art of flowers, plants, and garden scenes. Focus on capturing the delicate beauty and organic patterns of plant life. Use characters like @, *, ~, (), {}, [], |, /, \\, and others to show petals, leaves, stems, and botanical details. Create pieces that range from single flowers to full garden vistas. Emphasize natural growth patterns, the grace of flowering plants, and the intricate details of leaves and blooms. Each creation should feel like a living garden captured in ASCII form.","priceDescription":"per botanical creation","inputSchema":{"type":"object","properties":{"plant":{"type":"string","description":"Type of plant or flower (e.g., ''rose'', ''cherry blossom'', ''succulent garden'', ''wildflower meadow'')"},"arrangement":{"type":"string","description":"Composition style (e.g., ''single bloom'', ''bouquet'', ''garden bed'', ''hanging vines'')"},"season":{"type":"string","enum":["spring","summer","autumn","winter","any"],"description":"Seasonal theme","default":"any"}},"required":["plant"]}}', NULL, NULL, '2025-06-26 22:35:52.086+01', '2025-06-26 22:35:52.087007', '2025-06-26 22:35:52.087007');
